export default function Contras ({contras}) {
//    console.log(contras)
    function getNames(id) {
        if(id == 1) {
            return "Thiago"
        }
        if(id == 2) {
            return "Rick"
        }
        if(id == 3) {
            return "Joao"
        }
        if(id == 4) {
            return "Daniel"
        }
        if(id == 5) {
            return "Vitor"
        }
    }
    const players = Object.entries(contras)
   return (
       <div>
           { players.map((element) => {
               console.log(element[0])
        return  (
                <div>{getNames(element[1][0].id_player)}</div>
            )
        })}
       </div>
   )
     
}
